			carrier = null;
			if(flight.marketingCarriers != undefined){
				carrier = flight.marketingCarriers[0];
				flight.flightType = "SHARED_CODE";
			} else {
				carrier = flight.operatingCarrier;

			flightCode = carrier.airlineCode + carrier.flightNumber;

		rowStyle += !fids && !sita.flightType ? " missing_fids" : "";
